import React, { useState, useEffect } from 'react';
import { Home, Calendar, Ticket, User, LogOut, Menu, CalendarCheck } from 'lucide-react'; // ✅ Imported CalendarCheck
import { useNavigate, useLocation } from 'react-router-dom';

const Sidebar = ({ user, theme, onLogout }) => {
  const navigate = useNavigate();
  const location = useLocation();
  const isDark = theme === 'dark';
  const [isExpanded, setIsExpanded] = useState(false);
  const [iconSize, setIconSize] = useState(20);

  useEffect(() => {
    const handleResize = () => setIconSize(window.innerWidth < 1400 ? 18 : 22);
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  // Check Role
  const isTeacher = user && user.role === 'teacher';

  const menuItems = isTeacher 
    ? [
        { label: 'Dashboard', icon: <Home size={iconSize} />, path: '/' },
        // ✅ CHANGED ICON HERE: Used CalendarCheck instead of List
        { label: 'My Events', icon: <CalendarCheck size={iconSize} />, path: '/teacher-events' }, 
        { label: 'Registrations', icon: <Ticket size={iconSize} />, path: '/teacher-registrations' },
        { label: 'Profile', icon: <User size={iconSize} />, path: '/profile' },
      ]
    : [
        { label: 'Dashboard', icon: <Home size={iconSize} />, path: '/' },
        { label: 'Events', icon: <Calendar size={iconSize} />, path: '/events' },
        { label: 'My Tickets', icon: <Ticket size={iconSize} />, path: '/my-events' },
        { label: 'Profile', icon: <User size={iconSize} />, path: '/profile' },
      ];

  const styles = {
    sidebar: {
      height: '100vh',
      width: isExpanded ? '16vw' : '4vw', 
      minWidth: isExpanded ? '220px' : '60px', 
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRight: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      display: 'flex', flexDirection: 'column', padding: '1vh 0', 
      position: 'fixed', left: 0, top: 0, zIndex: 1000,
      transition: 'width 0.2s ease', overflowX: 'hidden',
    },
    menuItem: (isActive) => ({
      display: 'flex', alignItems: 'center', gap: '10px',
      padding: '12px 20px', cursor: 'pointer',
      backgroundColor: isActive ? (isDark ? '#334155' : '#eff6ff') : 'transparent',
      color: isActive ? '#6366f1' : '#64748b',
      borderLeft: isActive ? '4px solid #6366f1' : '4px solid transparent',
      whiteSpace: 'nowrap'
    }),
    label: { display: isExpanded ? 'block' : 'none', fontWeight: '500', fontSize:'14px' }
  };

  return (
    <div style={styles.sidebar}>
      {/* Toggle */}
      <div style={{ padding: '20px', cursor: 'pointer', display: 'flex', gap: '10px', alignItems: 'center' }} onClick={() => setIsExpanded(!isExpanded)}>
        <Menu size={iconSize} color={isDark ? '#fff' : '#000'} />
        {isExpanded && <span style={{ fontWeight: 'bold', color: '#6366f1', fontSize:'18px' }}>EventSphere</span>}
      </div>

      {/* Menu */}
      <div style={{ flex: 1 }}>
        {menuItems.map((item) => (
          <div key={item.label} style={styles.menuItem(location.pathname === item.path)} onClick={() => navigate(item.path)}>
            {item.icon}
            <span style={styles.label}>{item.label}</span>
          </div>
        ))}
      </div>

      {/* Logout */}
      <div style={styles.menuItem(false)} onClick={onLogout}>
        <LogOut size={iconSize} color="#ef4444" />
        <span style={{ ...styles.label, color: '#ef4444' }}>Log Out</span>
      </div>
    </div>
  );
};

export default Sidebar;
